import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [resp, setResp] = useState([])

  fetch('p.json')
        .then(response => {response.json()})
        .then(json => console.log(json))
        .catch(e => console.log(e))

  return (
    <div className="App">
      {resp && console.log(resp)}
    </div>
  );
}

export default App;
